CREATE TABLE `tech_reports` (
	`id` INT(11) NOT NULL AUTO_INCREMENT,
	`num` VARCHAR(50) NULL DEFAULT NULL,
	`created` DATETIME NOT NULL,
	`user` INT(11) NOT NULL,
	`company` INT(11) NOT NULL,
	`client` INT(11) NOT NULL,
	`device` VARCHAR(255) NOT NULL,
	`inventory_number` VARCHAR(255) NULL DEFAULT NULL,
	`serial_number` VARCHAR(255) NULL DEFAULT 'нет',
	`production_date` DATE NULL DEFAULT NULL,
	`purchase_date` DATE NULL DEFAULT NULL,
	`initial_cost` DECIMAL(11,4) NULL DEFAULT NULL,
	`residual_cost` DECIMAL(11,4) NULL DEFAULT NULL,
	`fault` VARCHAR(255) NULL DEFAULT '',
	`diagnostic_result` TEXT NULL,
	`conclusion` TEXT NULL,
	`notes` TEXT NULL,
	PRIMARY KEY (`id`),
	INDEX `FK_tech_reports_users` (`user`),
	INDEX `FK_tech_reports_companies` (`company`),
	INDEX `FK_tech_reports_clients` (`client`),
	CONSTRAINT `FK_tech_reports_clients` FOREIGN KEY (`client`) REFERENCES `clients` (`id`) ON UPDATE NO ACTION ON DELETE NO ACTION,
	CONSTRAINT `FK_tech_reports_companies` FOREIGN KEY (`company`) REFERENCES `companies` (`id`) ON UPDATE NO ACTION ON DELETE NO ACTION,
	CONSTRAINT `FK_tech_reports_users` FOREIGN KEY (`user`) REFERENCES `users` (`id`) ON UPDATE NO ACTION ON DELETE NO ACTION
)
COMMENT='акты технического состояния'
COLLATE='utf8mb4_general_ci'
ENGINE=InnoDB
AUTO_INCREMENT=1;

